import Navbar from '../src/components/Navbar';
import { Home } from './components/Home';
import { Router } from 'react-router-dom';


function App() {
  return (
    <>
    <Router></Router>
    <Navbar/>
    <Home/> 
    <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      <h1>This is my TaskManager</h1>
    </>
  );
}

export default App;
